import React from 'react';
import AuthForm from './AuthForm';
import Header from './Header'

function Register({ onSignUp, redirectToLogin }) {
    return (
        <>
            <Header title={'Войти'} handleClick={redirectToLogin}/>
            <AuthForm title={'Регистрация'} onSubmit={onSignUp} buttonTitle={'Зарегистрироваться'} />
            <p className="header__text" >Уже зарегистрированы? <p onClick={redirectToLogin}>Войти</p></p>
        </>
    );
}

export default Register;
